import React from "react";
import ListItem from "./ListItem";

function Hufflepuff({id, names, handleRemove}){

  console.log("(H) Students: ", name)

  return(
    <div>
      <header>
        Hufflepuff Students
      </header>
      {<ListItem 
       key={id}
       student_name={names}
       onRemove={handleRemove}
      /> }
    </div>
  )
}

export default Hufflepuff;
